class Solution:
    def arrayNesting(self, nums: 'List[int]') -> int:
        def helper(dp, pos, arr, seen):
            if pos in dp:
                return dp[pos]
            elif pos == arr[pos]:
                dp[pos] = 1
                return dp[pos]
            else:
                if pos not in seen:
                    seen.add(pos)
                    dp[pos] = 1+ helper(dp, arr[pos], arr, seen)
                    # print(seen)
                    return dp[pos]
                else: # it has been seen in the path, a loop is detected
                    #dp[pos] = len(seen)+1
                    return 0

        dp = {}
        for i in range(len(nums)):
            helper(dp, i, nums, set())
            # print(dp)
        return max(dp.values())



